import React, { Component } from 'react'
import Table from '../table'

const url = 'http://localhost:3000/';

export default class Body extends Component {
    state = {
        data:[]
    };
    
    componentDidMount(){
      
        fetch(url +'attendance/getRecent/30')
        .then(response=>{
            return response.json();
        })
        .then(json=>{
            this.setState({
                data:json
            })
        })
    }
    render() {
        return (
            <div style={bodyStyle}>
                <div style={titleStyle}>Recently Added</div>
                <Table data = {this.state.data}/>
            </div>
        )
    }
}

const bodyStyle = {
};

const titleStyle = {
    backgroundColor:'#4CAF50',
    fontWeight:'400px',
    marginTop:'10px',
    color:'white',
    padding:'20px',
    fontSize:'20px',
};
